import './App.css';
import React from "react";

import Home from "./pages/Home";
import Meny from "./pages/Meny";

import {BrowserRouter as Router, Route, Routes} from "react-router-dom";

function App() {
  return (
    <div> 
      <Router>
      <Routes>
      <Route path='/' element={<Home/>} />
      <Route path="/Meny" component={Meny}/>
      </Routes>
      </Router>
    </div>
  );
}

export default App;
